const Skillsicons = () => {
    return (
        icons.map(icon => (
            <SkillsIcon key={icon.label} skill={icon} />
        ))
    )
}

    const SkillsIcon = ({ skill }: { skill: { label: string; icon: React.ReactElement } }) => {
    // icon.icon.className = 'bg-red-500';
    const modifiedIcon = React.cloneElement(skill.icon, {
        className: 'h-6 w-6 md:h-16 md:w-16',
    });
    return (
        <div className='aspect-square h-[60px] md:h-[100px] bg-[#00BCD333] rounded-full inline-flex items-center justify-center'>
            {modifiedIcon}
        </div>
    )
}

export default Skillsicons;